.datepicker--cell {
  height: 40px;
  width: 40px;
  border-radius: 50%;
}
.datepicker--cell.-range-from- {
  border: none;
  border-radius: 50%;
  background: #BC9CFF;
  font-weight: bold;
}
.datepicker--cell.-range-from-::after {
  content: "";
  height: 100%;
  width: 60%;
  position: absolute;
  left: 16px;
  background: #BC9CFF;
  opacity: 0.25;
  z-index: -1;
}
.datepicker--cell.-range-to- {
  border: none;
  border-radius: 50%;
  background: #BC9CFF;
  font-weight: bold;
}
.datepicker--cell.-range-to-::before {
  content: "";
  height: 100%;
  width: 60%;
  position: absolute;
  right: 16px;
  background-color: #BC9CFF;
  opacity: 0.25;
  z-index: -1;
}
.datepicker--cell.-current- {
  background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
  border-radius: 50%;
  color: #FFF;
  font-weight: bold;
}
.datepicker--cell:hover {
  color: #fff;
  font-weight: bold;
  background-color: #BC9CFF;
  border-radius: 50%;
}
.datepicker--cell.-selected- {
  color: #fff;
  font-weight: bold;
  background: #BC9CFF;
}
.datepicker--cell.-selected-.-current- {
  background: #BC9CFF;
  color: #fff;
}
.datepicker--cell.-selected-.-current-::after, .datepicker--cell.-selected-.-current-::before {
  background: none;
}
.datepicker--cell.-selected-.-focus- {
  background: #BC9CFF;
  color: #fff;
}
.datepicker--cell.-selected-.-focus-::after, .datepicker--cell.-selected-.-focus-::before {
  background: none;
}
.datepicker--cell.-in-range- {
  background: none;
  color: rgba(31, 32, 65, 0.5);
}
.datepicker--cell.-in-range-::before {
  content: "";
  z-index: -1;
  background: #BC9CFF;
  opacity: 0.25;
  width: 100%;
  height: 100%;
  position: absolute;
}
.datepicker--cell-day.-other-month-, .datepicker .datepicker--cell-year.-other-decade {
  color: rgba(31, 32, 65, 0.25);
}
.datepicker--cell-day.-other-month-:hover, .datepicker .datepicker--cell-year.-other-decade:hover {
  background: #BC9CFF;
  color: #fff;
  font-weight: bold;
  border-radius: 50%;
}
.datepicker--cell-day.-other-month-.-selected-, .datepicker .datepicker--cell-year.-other-decade.-selected- {
  background-color: #BC9CFF;
}
