// main buttons

@mixin transparent-button {
    @include body-text;
    white-space: nowrap;
    text-transform: uppercase;
    font-size: 12px;
    font-weight: bold;

    color: $purple-color;
    text-transform: uppercase;
    background-color: #FFF;
    background-clip: padding-box;
    border: 2px solid transparent;
    border-radius: 22px;

    padding: 12px 17.5px;
    margin: auto;
    position: relative;
    z-index: 1;

    &::before {
        content: '';
        position: absolute;
        top: 0; left: 0; bottom: 0; right:0;
        margin: -2px;
        z-index: -1;
        background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
        border-radius: 22px;
    }
    &:visited {
        color: $purple-color;
    }
}

@mixin transparent-button-hover {
    border: 2px solid rgba(225, 225, 225, 0.5);
}

@mixin purple-button {
    @include body-text;
    text-transform: uppercase;
    font-size: 12px;
    font-weight: bold;
    color: #FFF;
    padding: 9px 20px;
    border-radius: 22px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    text-align: center;
    display: block;
    &:visited {
        color: #fff;
    }
}

@mixin purple-button-hover {
    opacity: 0.5;
}

@mixin purple-button-arrow {
    &::after {
        content: '';
        background: url('../src/img/arrow_forward_button.svg');
        background-repeat: no-repeat;

        width: 20px;
        height: 20px;

        display: inline-block;
        position: absolute;
        left: 91%;
        top: 29%;            
    }
}


//small buttons

@mixin radio-check {
    position: absolute;
    z-index: -1;
    opacity: 0;
    &+label{
        display: inline-flex;
    }
    &+label::before {
        content: "";
        width: 20px;
        height: 20px;
        border: 1px solid $dark-shade-25-color;
        margin-right: 10px;
        cursor: pointer;
    }
    &:checked+label::before {   
        border-color: $purple-color;
    }
